import React from "react"
import {
    Typography, Button,
} from "@material-ui/core"

export const Header = () => {
    return (
        <div className = "component_header">
            <div className = "header_title">
                <Typography>
                    Filebox
                </Typography>
            </div>
            <div className = "header_logout">
                <Button>
                    Signout
                </Button>
            </div>
        </div>
    )
}
